import React from 'react';


const Logo: React.FC = () => {
  return (
    
    <div className='flex items-center gap-2'>
        <img src='/logo.svg' alt='Logo of BRLA' />
        <h2 className='text-xl font-bold text-heading-blue'>BRLA</h2>
    </div>
    
  );

};

export default Logo;
